import React, {useState, useEffect} from "react";
import './App.css';
import * as config from "./config"
import ResourceUsageBar from './ResourceUsageBar';
import ServicesSection from './ServicesSection';

function App() {
  const [servicesConfig, setServiceConfig] = useState([]);

    useEffect(() => {  
      config.servicesConfigLoader((error, result) => {
        if(error) {
          console.error(error);
        }
        else {
          setServiceConfig(result.services);
        }
      });
    }, []); // Empty dependency array ensures that the effect runs only once

  Object.values(servicesConfig).forEach(service => {
    console.log(service);
  });

  return (
    <div id="main-container">
      <ResourceUsageBar />
      <ServicesSection  />
    </div>
  );
}

export default App;
